### 1. **Local Storage**

You can use the `localStorage` API to store data in one tab and retrieve it in another. This method is simple, but it has some limitations, such as:

* Data is stored as strings, so you'll need to serialize and deserialize data.
* Data is not updated in real-time; you'll need to poll for changes.

Example:
```javascript
// Tab 1
localStorage.setItem('data', 'Hello, world!');

// Tab 2
