You can use a library like ModelMapper or Dozer to map your objects to DTOs. Here's an example using ModelMapper:

### Using ModelMapper

First, add the ModelMapper dependency to your project:

```xml
<dependency>
    <groupId>org.modelmapper</groupId>
    <artifactId>modelmapper</artifactId>
    <version>3.0.0</version>
</dependency>
```

Then, you can use ModelMapper to map your objects:

```java
import org.modelmapper.ModelMapper;

public List<UserDTO> getUsers() {
    List<User> users = userService.getUsers();
    ModelMapper modelMapper = new ModelMapper();
    List<UserDTO> userDTOs = users.stream()
            .map(user -> modelMapper.map(user, UserDTO.class))
            .collect(Collectors.toList());

    return userDTOs;
}
```

